import React from 'react';
import '../css/Tile.css';

const Tile = () => {
  const handleWhatsApp = () => {
    window.open('https://wa.me/98910 29137', '_blank');
  };

  const handleCall = () => {
    window.open('tel:9891029137', '_self');
  };

  const handleEnquire = () => {
    document.querySelector('.second-popup-overlay').style.display = 'block';
  };

  return (
    <div className="floating-tile">
      <button className="tile-button whatsapp" onClick={handleWhatsApp}>
        <i className="fa fa-whatsapp"></i> WhatsApp
      </button>
      <button className="tile-button call" onClick={handleCall}>
        <i className="fa fa-phone"></i> Call
      </button>
      <button className="tile-button enquire" onClick={handleEnquire}>
        <i className="fa fa-envelope"></i> Enquire
      </button>
    </div>
  );
};

export default Tile;
